pragma solidity ^0.4.8;

import "./base/owned.sol";

/**
 * Eternal Storage contract to keep track of Cognate Listings
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
contract CognateRegistry is owned(msg.sender) {

    // mapping to keep track of all Cognate Listings
    mapping(string => address[]) listingMap;

    // Events
    event Added(string key, address listing);

    //--------------
    // External API
    //--------------

    // Restricted
    //-----------

    /**
     * Add a listing to the registry
     */
    function add(string key, address listing) external onlyOwner {
        listingMap[key].push(listing);
        Added(key, listing);
    }

    // Public
    //-------

    /**
     * Retrieve the array of addresses of a listing with the given mark
     */
    function get(string key) external constant onlyOwner returns (address[]) {
        return listingMap[key];
    }

    /**
     * Remove a listing address from the array for the given key (if it exists)
     */
    function remove(string key, address listing) external onlyOwner {
        address[] storage keyArray = listingMap[key];

        for(uint i = 0; i < keyArray.length; i++) {
            if(keyArray[i] == listing) {
                keyArray[i] = keyArray[keyArray.length - 1];
                keyArray.length--;
            }
        }
    }
}
